import React from "react";

let style = {height:"50px",backgroundColor:"#ffffff", border:"1px solid", borderColor:"black"};
const FooterPage = () => {
    return (

                    <div style={style}>
                        <h2  style={{textAlign:"center", margin:"5px 5px"}}>Footer</h2>
                    </div>

    );
}

export default FooterPage;
